    false,nt"url": null,nt"notes": "This narrative report for National Bison
    Range outlines Refuge accomplishments from November, 1940 through January 1941.
    The report begins by summarizing the weather conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, mammals, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments and plantings. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses and violations. Photographs are attached.",nt"license_title":
